from Crypto.Util.number import bytes_to_long,long_to_bytes
x1 = ''
sus1 = bytes_to_long(bytes.fromhex(x1))
x2 = ''
sus2 = bytes_to_long(bytes.fromhex(x2))
x3 = ''
sus3 = bytes_to_long(bytes.fromhex(x3))

p = sus3
import sys
sys.setrecursionlimit(100000)

def Recursion(number,counter):
    if counter!=1:
        if counter%2==0:
            counter//=2
            number = pow(number,2,p)
            number = Recursion(number,counter)
        else:
            counter-=1
            dest = number
            number = Recursion(number,counter)
            number = (number*dest)%p
    return number

print(long_to_bytes(pow(sus2,sus1,sus3)))
